			["displayText_format_p_time_dynamic_threshold"] = 60,
			["customText"] = "function()\n    if WeakAuras.IsOptionsOpen() then return \"\" end\n    -- Anima Powers (Soggodon,Arkolath,Oros,Varruth)\n    local tankPowers = {{\"The Stone Ward\",\"Broken Mirror\",\"Dripping Fang\"},{\"Champion\\39s Brand\",\"Crumbling Bulwark\",\"The Fifth Skull\"},{\"Handbook of Uncivil Etiquette\",\"Huntsman\\39s Horn\",\"Pendant of the Martyr\"},{\"Champion\\39s Brand\",\"The Stygian King\\39s Barbs\",\"Siegebreaker\\39s Stand\"}}\n    \n    local healPowers = {{\"The Stone Ward\",\"Self-Embalming Kit\",\"Tiny Dancing Shoes\"},{\"Champion\\39s Brand\",\"Bottle of Sanguine Ichor\",\"Pedestal of Utter Hubris\"},{\"Satchel of the Hunt\",\"Portable Feeding Trough\",\"Gavel of Judgement\"},{\"Champion\\39s Brand\",\"Overflowing Chalice\",\"Stabilizing Diamond Alembic\"}}\n    \n    local dpsPowers = {{\"The Stone Ward\",\"Dripping Fang\",\"Tiny Dancing Shoes\"},{\"Champion\\39s Brand\",\"Raging Battle-Axe\",\"Signet of Bolstering\"},{\"Regenerative Fungus\",\"Vial of Desperation\",\"Handbook of Uncivil Etiquette\"},{\"Champion\\39s Brand\",\"Dagger of Necrotic Wounding\",\"Volcanic Plumage\"}}\n    \n    local role\n    if UnitInParty(\"player\") then\n        role = UnitGroupRolesAssigned(\"player\")\n    else\n        print(GetInspectSpecialization(\"player\"))\n        if GetInspectSpecialization(\"player\") == 0 then\n            print(\"The server denied your query\")\n        else\n            for k,v in ipairs(aura_env.tankIDs) do\n                if v == GetInspectSpecialization(\"player\") then\n                    role = \"TANK\"\n                    break\n                    \n                end\n            end\n            \n            for k,v in ipairs(aura_env.healerIDs) do\n                if v == GetInspectSpecialization(\"player\") then\n                    role = \"HEALER\"\n                    break\n                end\n            end\n            \n            for k,v in ipairs(aura_env.dpsIDs) do\n                if v == GetInspectSpecialization(\"player\") then\n                    role = \"DAMAGER\"\n                    break\n                end\n            end\n        end\n    end\n    local bossName = {\"Soggodon the Breaker\",\"Incinerator Arkolath\",\"Oros Coldheart\",\"Executioner Varruth\"}\n    local function PrintHandler(comparisonString,powerString)\n        for k,v in pairs(powerString) do\n            \n            print(bossName[k])\n            local newString = \"\"\n            for _,n in pairs(v) do\n                newString=newString..\"|T\"..GetSpellTexture(comparisonString[n])..\":16:16:0:0:64:64:4:60:4:60|t\"..GetSpellLink(comparisonString[n])\n            end\n            if k == 4 then\n                print(newString..\"\\n\")\n                \n            else\n                print(newString..\"\\n\\n\")\n            end\n        end\n    end\n    if role == (\"TANK\" or 1) then\n        PrintHandler(aura_env.powersTank,tankPowers)\n    else \n        if role == (\"HEALER\" or 2) then\n            PrintHandler(aura_env.powersHeal,healPowers)\n        else \n            if role == (\"DAMAGER\" or 3) then\n                PrintHandler(aura_env.powersDps,dpsPowers)\n            end\n        end\n    end\nend\n\n\n-- aura_env.powersDps[n]",
