				["init"] = {
					["custom"] = "-- Custom Option Keys\naura_env.options = {'party', 'guild', 'spam'}\n\n-- Custom Option Table\naura_env.types = {}\n\nfor _, v in ipairs(aura_env.options) do\n    \n    if aura_env.config[\"enabled\"..v] then\n        aura_env.types[v] = true\n    end\n    \nend\n\n-- Keystone Item IDs\naura_env.ids = {\n    [138019] = true, -- Legion\n    [158923] = true, -- BfA\n    [180653] = true, -- Shadowlands\n    [151086] = true, -- Tournament\n}\n\n-- Make sure key is nil to force update\naura_env.key = nil\n\n-- Search the Bags for the item IDs from the table above\naura_env.update = function()\n    for bag = 0, NUM_BAG_SLOTS do\n        local bSlots = GetContainerNumSlots(bag)\n        for slot = 1, bSlots do\n            local itemLink, _, _, itemID = select(7, GetContainerItemInfo(bag, slot))\n            if aura_env.ids[itemID] then\n                aura_env.key = itemLink\n                return\n            end\n        end\n    end\nend\n\n-- Channel and Anti-Spam check\naura_env.link = function(channel)\n    \n    channel = channel or \"PARTY\"\n    \n    if channel == \"PARTY\" then\n        if aura_env.config.spam and (aura_env.timeParty or 0) > (GetTime() - 30) then\n            return\n        end\n        aura_env.timeParty = GetTime()\n    else\n        if aura_env.config.spam and (aura_env.timeGuild or 0) > (GetTime() - 30) then\n            return\n        end\n        aura_env.timeGuild = GetTime()\n    end\n    \n    if aura_env.key == nil then aura_env.update() end\n    if aura_env.key ~= nil then \n        SendChatMessage(aura_env.key, channel)\n    end\nend\n\n-- Covenant print (by Stanzilla)\nlocal covenantID = C_Covenants.GetActiveCovenantID()\nlocal data = C_Covenants.GetCovenantData(covenantID)\n\nif data then \n    aura_env.covenantName = data.name\nend",
