						["custom"] = "function(allstates, event, ...)\n    if event == \"COMBAT_LOG_EVENT_UNFILTERED\" then\n        --if not UnitExists(destName) then return false end\n        local timestamp, subEvent, hideCaster, sourceGUID, sourceName, sourceFlags, sourceRaidFlags, destGUID, destName, destFlags, destRaidFlags, spellId, _, _, auraType = ...\n        \n        if subEvent == \"SPELL_CAST_SUCCESS\" and aura_env.spellIDs[spellId] then\n            if aura_env.debug then print(\"SPELL_CAST_SUCCESS\", aura_env.bondUnit, aura_env.spellIDs[spellId], sourceName) end\n            \n            -- if correct trigger spell found, but no boud unit saved - bond aura partner unit recovery, for example after reload or /wa used\n            if aura_env.bondUnit == nil then\n                local source = select(7, WA_GetUnitAura(\"player\", aura_env.bondAuraId))\n                if aura_env.debug then print(\"Source\", source, UnitName(source)) end\n\n                if source ~= nil then -- bond aura partner unit recovery, for example after reload or /wa used\n                    aura_env.bondUnit = UnitName(source)\n                end\n            end\n\n            if aura_env.bondUnit and sourceName == aura_env.bondUnit then -- UnitName(aura_env.bondUnit)\n                if aura_env.debug then print(sourceName, aura_env.bondUnit, UnitName(aura_env.bondUnit), spellId, aura_env.spellIDs[spellId]) end\n                local name, _, icon = GetSpellInfo(spellId)\n\n                allstates[aura_env.id] = {\n                    show = true,\n                    changed = true,\n                    progressType = \"timed\",\n                    duration = aura_env.config.duration,\n                    expirationTime = GetTime() + aura_env.config.duration,\n                    autoHide = true,\n                    source = UnitName(sourceName),\n                    name = name,\n                    icon = icon,\n                }\n                return true\n            end\n        elseif subEvent == \"SPELL_AURA_APPLIED\" then\n            if spellId == aura_env.bondAuraId and destName == UnitName(\"player\") then\n                if aura_env.debug then\n                    print(\"Bond:\", sourceName, destName)\n                    print(\"SPELL_AURA_APPLIED\", spellId, aura_env.bondAuraId, sourceName, destName)\n                end\n\n                aura_env.bondUnit = sourceName\n            end\n        elseif subEvent == \"SPELL_AURA_REMOVED\" then\n            --if aura_env.debug then print(\"SPELL_AURA_REMOVED\", spellId, aura_env.bondAuraId, sourceName, destName) end\n            if spellId == aura_env.bondAuraId and destName == UnitName(\"player\") then\n                if aura_env.debug then print(\"No bond:\", sourceName, destName) end\n                aura_env.bondUnit = nil\n            end\n        end\n    end\n    return false\nend",
