			["customText"] = "function()\n    if GetLocale() ~= \"enGB\" and GetLocale() ~= \"enUS\" then\n        return \"This WeakAura does not support \"..GetLocale()\n    end\n    \n    -- Anima Powers (Soggodon,Arkolath,Oros,Varruth)\n    local tankPowers = {{\"The Stone Ward\",\"Broken Mirror\",\"Dripping Fang\"},{\"Champion\\39s Brand\",\"Crumbling Bulwark\",\"The Fifth Skull\"},{\"Handbook of Uncivil Etiquette\",\"Huntsman\\39s Horn\",\"Pendant of the Martyr\"},{\"Champion\\39s Brand\",\"The Stygian King\\39s Barbs\",\"Siegebreaker\\39s Stand\"}}\n    \n    local healPowers = {{\"The Stone Ward\",\"Self-Embalming Kit\",\"Tiny Dancing Shoes\"},{\"Champion\\39s Brand\",\"Bottle of Sanguine Ichor\",\"Pedestal of Utter Hubris\"},{\"Satchel of the Hunt\",\"Portable Feeding Trough\",\"Gavel of Judgement\"},{\"Champion\\39s Brand\",\"Overflowing Chalice\",\"Stabilizing Diamond Alembic\"}}\n    \n    local dpsPowers = {{\"The Stone Ward\",\"Dripping Fang\",\"Tiny Dancing Shoes\"},{\"Champion\\39s Brand\",\"Raging Battle-Axe\",\"Signet of Bolstering\"},{\"Regenerative Fungus\",\"Vial of Desperation\",\"Handbook of Uncivil Etiquette\"},{\"Champion\\39s Brand\",\"Dagger of Necrotic Wounding\",\"Volcanic Plumage\"}}\n    local role\n    if UnitInParty(\"player\") then\n        role = UnitGroupRolesAssigned(\"player\")\n    else\n        return \"Player is not in a party\"\n    end\n    \n    local data = C_PlayerChoice.GetPlayerChoiceInfo()\n    if not data then return \"\" end\n    local amountPowers = data[\"numOptions\"]\n    \n    local function SendResponse(comparisonString)\n        --print(comparisonString)\n        if not comparisonString then\n            return \"Manual Selection Enabled\"\n        else\n            for index=1,amountPowers do\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(index)[\"header\"] == comparisonString) then\n                    local returnID = C_PlayerChoice.GetPlayerChoiceOptionInfo(index)[\"responseIdentifier\"]\n                    C_PlayerChoice.SendPlayerChoiceResponse(returnID)\n                    ClosePlayerChoice()\n                    if aura_env.config.announcer and UnitInParty(\"player\") then\n                        local announceString = \"Picked Power: \"..GetSpellLink(data[\"options\"][index][\"spellID\"])\n                        SendChatMessage(announceString ,\"party\");\n                    end\n                    return \"\"\n    end end end end\n    \n    \n    -- Detect boss\n    if data ~= nil then\n        if role == \"TANK\" then -- If Tank role\n            for i=1,amountPowers do\n                -- Check if Soggodon the Breaker\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"The Stone Ward\") then\n                    return SendResponse(tankPowers[1][aura_env.config.soggodon.sogTank-1])\n                end\n                -- Check if Incinerator Arkolath\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"The Fifth Skull\") then\n                    return SendResponse(tankPowers[2][aura_env.config.arkolath.arkTank-1])\n                end\n                -- Check if Coldheart Oros\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"Pendant of the Martyr\") then\n                    return SendResponse(tankPowers[3][aura_env.config.oros.orosTank-1])\n                end\n                -- Check if Executioner Varruth\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"Siegebreaker\\39s Stand\") then\n                    return SendResponse(tankPowers[4][aura_env.config.varruth.varTank-1])\n        end end end\n        \n        if role == \"HEALER\" then -- If Heal role\n            for i=1,amountPowers do\n                -- Check if Soggodon the Breaker\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"The Stone Ward\") then\n                    return SendResponse(healPowers[1][aura_env.config.soggodon.sogHeal-1])\n                end\n                -- Check if Incinerator Arkolath\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"Pedestal of Utter Hubris\") then\n                    return SendResponse(healPowers[2][aura_env.config.arkolath.arkHeal-1])\n                end\n                -- Check if Coldheart Oros\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"Gavel of Judgement\") then\n                    return SendResponse(healPowers[3][aura_env.config.oros.orosHeal-1])\n                end\n                -- Check if Executioner Varruth\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"Overflowing Chalice\") then\n                    return SendResponse(healPowers[4][aura_env.config.varruth.varHeal-1])\n        end end end\n        \n        if role == \"DAMAGER\" then -- If Damage role\n            for i=1,amountPowers do\n                -- Check if Soggodon the Breaker\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"The Stone Ward\") then\n                    return SendResponse(dpsPowers[1][aura_env.config.soggodon.sogDPS-1])\n                end\n                -- Check if Incinerator Arkolath\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"Signet of Bolstering\") then\n                    return SendResponse(dpsPowers[2][aura_env.config.arkolath.arkDPS-1])\n                end\n                -- Check if Coldheart Oros\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"Regenerative Fungus\") then\n                    return SendResponse(dpsPowers[3][aura_env.config.oros.orosDPS-1])\n                end\n                -- Check if Executioner Varruth\n                if (C_PlayerChoice.GetPlayerChoiceOptionInfo(i)[\"header\"] == \"Volcanic Plumage\") then\n                    return SendResponse(dpsPowers[4][aura_env.config.varruth.varDPS-1])\n    end end end end\n    return \"ERROR\\nCould not automatically select\"\nend\n\n\n",
